// src/componentes/elementos/Categorias.js
const Categorias = ({ onSeleccionar }) => {
  const categorias = [
    'Boxer sin costuras',
    'Boxer sin costura',
    'Boxer microfibra deportivo',
    'Boxer algodón premium',
    'Boxer mezcla stretch',
    'Boxer compresión ligera',
  ];

  return (
    <div className="catalogo-categorias">
      <h3>Categorías</h3>
      <ul>
        {categorias.map((cat) => (
          <li key={cat} onClick={() => onSeleccionar(cat)}>{cat}</li>
        ))}
        <li onClick={() => onSeleccionar('')}>Ver todo</li>
        <li onClick={() => onSeleccionar('')}>Boxer sin costuras</li>
        <li onClick={() => onSeleccionar('')}>Boxer sin costuras</li>
        <li onClick={() => onSeleccionar('')}>Boxer sin costuras</li>
      </ul>
    </div>
  );
};

export default Categorias;
